function Matcher(res) {
    return function(txt) {
        var match;
        for (var i = 0; i < res.length; i++) {
            match = txt.match(res[i][1]);
            if (match) return {
                type: res[i][0],
                match: match,
                text: txt
            };
        }
        return {
            text: txt
        };
    };
}
